import React from 'react'
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { Game, GameList, SportSelector, Team, HomeScreen } from './components/Exports'

const Tab = createBottomTabNavigator()

const Tabs = () => {

    return (
            <Tab.Navigator 
                screenOptions={({ route }) => ({
                tabBarIcon: ({ focused, color, size }) => {
                let iconName;

                if (route.name === 'Home') {
                iconName = focused
                    ? 'home' : 'home'
                } else if (route.name === 'Profile') {
                iconName = focused ? 'person-circle-sharp' : 'person-circle-sharp'
                } else if (route.name === 'Rewards') {
                    iconName = focused ? 'ribbon' : 'ribbon'
                } else if (route.name === 'Betslip') {
                    iconName = focused ? 'receipt' : 'receipt'
                } else if (route.name === 'Favorites') {
                    iconName = focused ? 'star' : 'star'
                }

                return <Ionicons name={iconName} size={28} color={color} />;
                },
            })} 
            tabBarOptions={{
                initialRouteName: "Home",
                activeBackgroundColor: '#161616',
                inactiveBackgroundColor: '#161616',
                activeTintColor: '#1398A0',
                inactiveTintColor: 'grey',
                style: {height: 100},
        }}>
        <Tab.Screen name="Home" component={HomeScreenTab} />
        <Tab.Screen name="Profile" component={ProfileScreenTab} />
        <Tab.Screen name="Rewards" component={RewardsScreenTab} />
        <Tab.Screen name="Betslip" component={BetslipScreenTab} />
        <Tab.Screen name="Favorites" component={BetslipScreenTab} />
        </Tab.Navigator>

    )
}

export default Tabs
